import React from 'react';
import image1 from './images/image1.jpg'
import image8 from './images/image8.jpg'
function Store(){
    return(
        <>
        <div className='d-flex text-center gap-2 store-container bg-info'>
            <figure>
                <img src={image1} />
            </figure>
            <figure>
                <img src={image7} />
            </figure>
        </div>
        </>
    )
}

export default Store;
